import React, { Component } from 'react';
class UserOptionPage extends Component {
    constructor(props){
        super(props);
        console.log(props);
    }
    render() { 
        return ( 
            <div>
                <button className="btn btn-block btn-primary" text="Markup Documents" style={btn_styles}></button>
                <button className="btn btn-block btn-primary" text="Upload Document"></button>
            </div>
         );
    }
}
const btn_styles ={
    "width" : "50%"
}
 
export default UserOptionPage;
